BUEN DIA COMPAÑERO; 
TE DESEO UN EXCELENTE DIA...
Q APRENDAS MUCHO Y RECUERDES PONER LA MEJOR ACTITUD PARA Q TODO JIRE EN POSITIVO NO OLVIDANDO  QUE TA.O ....

Olá, pessoal. Bom dia!

Todos que solicitaram a aprovação da visita da L'Oréal já estão no calendário. Peço, por gentileza, que informem a data que realizarão o contato no próprio calendário.

- Meninas, por favor, realizem, no mínimo, até duas visitas por dia;
- Meninos, vocês podem optar por realizar uma ou até duas por dia;

Dessa maneira, conseguiremos finalizar essas primeiras avaliações ainda essa semana.

Agradeço a ajuda de todos!

Versículo do dia : Ouvi, SENHOR, a tua palavra e temi; 
aviva, ó SENHOR, a tua obra no meio dos anos, 
no meio dos anos a notifica; 
na ira lembra-te da misericórdia.  Habacuque 3: 2
